def segment_direction(segment):
	angle = 0
	xv, yv = segment.direction
	m = yv/ xv
	angle = math.degrees(math.atan(m)) % 360
	direction = 1
	if(xv < 0):
		angle = (angle + 180) % 360
		direction = 0
	return angle, direction

